import style from './AdressMap.module.css'
import LineRedHorr from '../../../UI/LineRedHorr'

const AdressMap = () => {
  return (
    <div className={style.adressMap}>
      <LineRedHorr />
      
      <div className={style.adressContacts}>Адрес: город Москва ул. Большая Очаковоская дом 42. стр. 1</div>
      <div className={style.mapFrame}></div>
    </div>
  )
}

export default AdressMap
